import React from 'react';

const CollectionItem = ({name, imageUrl, price})=>{

    return (
        <div className='collection-item'>
            <div className='image'
                style={{
                    backgroundImage:`url(${imageUrl})`,
                    height: 100,
                    width:100
                }}
            ></div>
            <div className='footer'>
                <div>{name}</div>
                <div>{`$${price}`}</div>
            </div>
        </div>
    );
}

export default CollectionItem;
